music = {
    initalized: false,
    init: function(){
        Tone.start();
        this.initalized == true;
    },
    synths:[],
    play: function(url, loop){
        if (this.player) {
            this.player.stop();
            this.player.dispose();
        }
        this.player = new Tone.Player(url).toDestination();
        // play as soon as the buffer is loaded
        this.player.loop = loop;
        this.player.autostart = true;
        this.player.volume.value = -20;
    },
    fadeOut: function(callback){
        if(this.player){
            if( this.player.volume.value>-50){
                this.player.volume.value-=7;
                setTimeout(()=>{music.fadeOut(callback)}, 75);
            }else {
                
                this.player.stop();
                if(callback){
                    callback();
                }
            }
        } else if (callback){
            callback()
        }
    },
    explore: function(){
        this.fadeOut(()=>{
            exploration="data:audio/mpeg;base64,"
            this.play(exploration, true)
        })
    },
    exitLevel: function(){
        this.fadeOut(()=>{
            exitLevel="data:audio/mpeg;base64,"
            this.play(exitLevel, true)
        })
    },
    death: function(){
        this.fadeOut(()=>{
            death = "data:audio/mpeg;base64,"
            this.play(death, true)
        })
    },
    start: function(){
        this.fadeOut(()=>{
            start = "data:audio/mpeg;base64,"
            this.play(start, false)
        })
    }
}

